import React from 'react'


class CreateMeetingCard extends React.Component {

    render(){
      return (

        <div style={{marginTop: "12em", color: "black"}} class="ui raised card">
        Date
        <input type="date" name="datetime" /><br/><br/>
        <select onChange={this.handleChange} name="location" required >
          <option label="Location"></option>
          <option label="New York City">Apt</option>
          <option value="Los Angeles">Townhouse</option>
          <option value="Boston">Igloo</option>
          <option value="Chicago">Chateau</option>
        </select> <br/>
        <button className="ui primary button">Set Up a Meeting With this Pet!</button>
        </div>

      )
    }
}


export default CreateMeetingCard
